pragma solidity ^0.5.16;
pragma experimental ABIEncoderV2;

import "./GeneralStorage.sol";

contract FactoryInfo  {
    GeneralStorage generalStorage;

    string  inFactoryTime = "inFactoryTime";
    string  carCert = "carCert";
    string  driver = "driver";
    string  level = "level";
    string  inWeight = "inWeight";
    string  inPicHash = "inPicHash";
    string  inVideoHash = "inVideoHash";

    string  outFactoryTime = "outFactoryTime";
    string  outPicHash = "outPicHash";
    string  outWeight = "outWeight";


    string  fundInfo = "fundInfo";
    string  fundPicHash = "fundPicHash";
    string  fundId = "fundId";
    string  fundValue = "fundValue";
    function setStorageAddress(address _addr) public{
        generalStorage = GeneralStorage(_addr);
    }

    function setInFactory(bytes memory _id,bytes memory _date,
                            bytes memory _cert,bytes memory _driver,
                            bytes memory _lvl,
                            bytes memory _weight) public{
        generalStorage.setStorage(_id,bytes(inFactoryTime),_date);
        generalStorage.setStorage(_id,bytes(carCert),_cert);
        generalStorage.setStorage(_id,bytes(driver),_driver);
        generalStorage.setStorage(_id,bytes(level),_lvl);
        generalStorage.setStorage(_id,bytes(inWeight),_weight);
    }

    function setInPic(bytes memory _id,bytes memory _pic,bytes memory _video) public{
        generalStorage.setStorage(_id,bytes(inPicHash),_pic);
        generalStorage.setStorage(_id,bytes(inVideoHash),_video);
    }

    function getInFactoryInfo(bytes memory _id) public view returns(bytes[] memory,bytes[] memory){
        bytes[] memory stages = new bytes[](7);
        bytes[] memory values = new bytes[](7);
        string[7] memory list = ["inFactoryTime","driver","carCert","level","inWeight","inPicHash","inVideoHash"];
        for (uint i = 0; i < 7; i++) {
            address from;
            bytes memory idinfo;
            bytes memory stage;
            bytes memory value;
            (from,idinfo,stage,value) = generalStorage.getStorage(_id,bytes(list[i]));
            stages[i] = stage;
            values[i] = value;
        }
        return (stages,values);
    }

    function setOutFactory(bytes memory _id,bytes memory _date,bytes memory _hash,bytes memory _weight) public{

        generalStorage.setStorage(_id,bytes(outFactoryTime),_date);
        generalStorage.setStorage(_id,bytes(outPicHash),_hash);
        generalStorage.setStorage(_id,bytes(outWeight),_weight);
    }

    function setOutPic(bytes memory _id,bytes memory _pic) public{
        generalStorage.setStorage(_id,bytes(outPicHash),_pic);
    }

    function getOutFactoryInfo(bytes memory _id) public view returns(bytes[] memory,bytes[] memory){
        bytes[] memory stages = new bytes[](4);
        bytes[] memory values = new bytes[](4);
        string[4] memory list = ["outFactoryTime","outPicHash","outWeight","outPicHash"];
        for (uint i = 0; i < 4; i++) {
            address from;
            bytes memory idinfo;
            bytes memory stage;
            bytes memory value;
            (from,idinfo,stage,value) = generalStorage.getStorage(_id,bytes(list[i]));
            stages[i] = stage;
            values[i] = value;
        }
        return (stages,values);
    }


    function setFund(bytes memory _id,bytes memory _pic,
                    bytes memory _fundid,bytes memory _fundValue
                    ) public{
        bytes[] memory keys = new bytes[](3);
        bytes[] memory values = new bytes[](3);
        keys[0] = bytes(fundPicHash);
        keys[1] = bytes(fundId);
        keys[2] = bytes(fundValue);
        values[0] = _pic;
        values[1] = _fundid;
        values[2] = _fundValue;
        generalStorage.setMapStorage(_id,bytes(fundInfo),keys,values);
    }

    function getFund(bytes memory _id) public view returns(bytes[] memory,bytes[] memory){
            address from;
            bytes memory idinfo;
            bytes memory stage;
            bytes[] memory keys;
            bytes[] memory values;
           (from,idinfo,stage,keys,values) = generalStorage.getMapStorage(_id,bytes(fundInfo));
           return (keys,values);
    }

    function getInfo(bytes memory _id) public view returns(bytes[] memory,bytes[] memory){

        bytes[] memory stages = new bytes[](10);
        bytes[] memory values = new bytes[](10);

        string[10] memory list = ["inFactoryTime","carCert","driver","level","inPicHash","inVideoHash","inWeight","outFactoryTime","outPicHash","outWeight"];

        for (uint i = 0; i < 10; i++) {
            address from;
            bytes memory idinfo;
            bytes memory stage;
            bytes memory value;
            (from,idinfo,stage,value) = generalStorage.getStorage(_id,bytes(list[i]));
            stages[i] = stage;
            values[i] = value;
        }
        return (stages,values);
    }
}
